function Header() {
	return (
		<header className="header">
			<div className="header-blank"></div>
			<div className="top-banner">
				<img alt="" src="/buttons/home-icon.svg" width="23px" color="white" />
				<img alt="" src="/buttons/menu-icon.svg" width="23px" color="white" />
			</div>
		</header>
	);
}

export default Header;
